import React from 'react';
import Chatting from '../../components/Chatting/Chatting';

const ChattingContainer = () => {
  const onSubmit = (e) => {
    e.preventDefault();
    console.log('onSubmit');
  };
  return <Chatting onSubmit={onSubmit} />;
};

export default ChattingContainer;
